        function hashKey(key) {
            return CryptoJS.SHA256(key).toString(CryptoJS.enc.Hex).substring(0, 32);
        }

        async function decryptImage() {
            const userKey = document.getElementById('decryptionKey').value;
            const hashedKey = hashKey(userKey);

            try {
                const decrypted = decrypt(encryptedBase64, hashedKey);

                // Display the decrypted image
                const img = document.getElementById('securedImage');
                img.src = `data:image/jpeg;base64,${decrypted}`;
                img.style.display = 'block';
            } catch (error) {
                alert('Seems like you got the wrong password.');
            }
        }

        function decrypt(encrypted, key) {
            try {
                const bytes = CryptoJS.AES.decrypt(encrypted, key);
                const originalBase64 = bytes.toString(CryptoJS.enc.Utf8);

                if (!originalBase64) throw new Error('Decryption failed');
                return originalBase64;
            } catch (err) {
                throw new Error('Wrong password');
            }
        }
    </script>
